// Basic route for testing
app.get('/', (req, res) => {
  res.send('Hello, Node.js server is running!');
});

// Route to fetch products
app.get('/products', (req, res) => {
  const { manufacturer, year, carName } = req.query;
  let filteredProducts = products;

  // Filter products based on query parameters
  if (manufacturer) {
      filteredProducts = filteredProducts.filter(product => product.manufacturer.toLowerCase() === manufacturer.toLowerCase());
  }
  if (year) {
      filteredProducts = filteredProducts.filter(product => product.year === parseInt(year));
  }
  if (carName) {
      filteredProducts = filteredProducts.filter(product => product['car name'].toLowerCase().includes(carName.toLowerCase()));
  }

  res.json(filteredProducts);
});
  
// GET /products/:id
app.get('/products/:id', (req, res) => {
  const product = products.find(p => p.id === parseInt(req.params.id));
  if (!product) return res.status(404).send('Product not found.');
  res.json(product);
});

// POST /products
app.post('/products', (req, res) => {
  const newProduct = req.body;
  newProduct.id = products.length + 1; // Auto increment id
  products.push(newProduct);
  res.status(201).json(newProduct);
});

// PUT /products/:id
app.put('/products/:id', (req, res) => {
  const productIndex = products.findIndex(p => p.id === parseInt(req.params.id));
  if (productIndex === -1) return res.status(404).send('Product not found.');

  const updatedProduct = { ...products[productIndex], ...req.body };
  products[productIndex] = updatedProduct;
  res.json(updatedProduct);
});

// Start the server
const PORT = 3000;
app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
